import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function HomeNav() {
	const [click, setClick] = useState(false);

	const handleClick = () => setClick(!click);

	return (
		<>
			<h1>HOME</h1>
		</>
	);
}

export default HomeNav;
